        broadcast chan inspirar, espirar;
        broadcast chan endSetup;
        broadcast chan expOn, expOff;
        broadcast chan O2mixed;
        broadcast chan airMixed;

        int Q; // Int representation of q
        /**sefsefse
        Tendremos dos inyectores, uno de aire y uno de oxigeno
        Cada inyector tiene un dato tipo bool que indica si está encendido o no: isOn
        Además un entero que indica el caudal que circulará

        **/
        typedef struct {
        bool isOn;
        int caudal;
        } Inyector;

const double PI = 3.141592;
const double d1 = 0.0254; // m
const double l1 = 3.0; // longitud mangera 1 m
const double l2 = 0.3; // longitud mangera 2 m
const double dt = 0.01; // s/
const double w = 1.81E-5; // Ns / m^2
const double R = 8.31446; // Constante gases ideales (m^3Pa / (K mol))
const int T = 37; // Temperatura del aire al inspirar (C)
const double rho = 0.044; // Densidad del aire en los pulmones (kg/m^3)

double q;
double v1 = 4250.0E-6; // volumen del tanque 1 m^3
double v2 = 1.0E-3;    // volumen del tanque 2 m^3
double p1 = 68947.6; // Presion inicial del tanque 1 Pa
double p2 = 6894.76; // Presion inicial del tanque 2 Pa
int correct;

double getDelta() {
    return (q*dt*R*rho)/v2;
}

double getQ(double p_i, double p_j, double l) {
    return (PI* (p_i-p_j) * pow(d1,4)) / (l*128*w);
}

template.declaration:
// Place local declarations here. /** Configuración de ciclos de trabajo de los inyectores flowrate: Es el caudal requerido ([L^3 T^-1]; dado en litros por minuto ) FiO2: Fracción de oxígeno inspirado, dado en porcentaje de oxigeno en el aire **/ int[0,500] O2InAir; int[0,500] o2WithoutAir;
/** De acuerdo a la siguiente tabla
| x | y | ------------ | 120 | 30 | | 220 | 40 | | 280 | 50 | | 350 | 60 | | 380 | 70 | | 410 | 80 | | 450 | 90 | | 500 | 100 |
Se construye una función para extrapolar los valores, dicha función es de grado 2 debido al desbordamiento de int teniendo f(x) = 0,0001x^2+0,1441x+3,6656 **/
int getDuty(int x){ return (x<=120)? 30: (x<=220)? 40: (x<=280)? 50: (x<=350)? 60: (x<=380)? 70: (x<=410)? 80: (x<=450)? 90: 100; //more than 450, expected until 500
}
double setPressure1() { return (R*T*rho*(Q))/v2; }

clock time;
/** De acuerdo a la siguiente tabla
| apertura | caudal | --------------------- | 30 | 120 | | 40 | 220 | | 50 | 280 | | 60 | 350 | | 70 | 380 | | 80 | 410 | | 90 | 450 | | 100 | 500 |
Adicionales para completar las posibilidades con el duty de 30% | apertura | caudal | --------------------- | 00 | 120 | | 10 | 120 | | 20 | 120 |
**/ int params[11] = {120,120,120,120,220,280,350,380,410,450,500};
int getFlowWithPassage(int n){ return params[n/10]; }

nta.system:
// Place template instantiations here.

    /**
    Input params:
    Inspiration time (tInsp) cs
    Expiration time  (tExp)  cs
    Inspiration pause (pInsp)cs
    Expiration pause  (pExp) cs
    Flowrate 
    FiO2
    */
    const int tInsp=100;
    const int tExp=250;
    const int pInsp=20;
    const int pExp=30;
    const int totalT = tInsp + tExp;

        /**
        Configuración de ciclos de trabajo de los inyectores
        flowrate: Es el caudal requerido ([L^3 T^-1]; dado en litros por minuto ) en un Dominio [0,500]
        FiO2: Fracción de oxígeno inspirado, dado en porcentaje de oxigeno en el aire en un Dominio [0,100]

        **/
        int[0,500] flowrateParam=30;
        int[0,100] FiO2=20;

        /**
        Porcentaje de tiempo por segundo que va a estar activo el inyector para generar el caudal requerido,
        tenemos un inyector de aire y uno de oxigeno
        airDuty: Porcentaje de apertura durante un segundo para suministrar aire
        o2Duty: Porcentaje de apertura durante un segundo para suministrar oxigeno
        **/
        int[0,100] airDuty;
        int[0,100] o2Duty;

        /**
        Notificación de parte del configurador de inyectores al controlador de que están listos a través del canal finConfiguracion
        **/
        broadcast chan endConfig;


        //flowrate, FiO2, inputs
        //airDuty, o2Duty, outputs
        //finConfiguracion, canal para informar a ventilator que ya están los outputs asignados
        Config = Setup(flowrateParam, FiO2, airDuty, o2Duty);



        /**
        Regular mezcla

        **/

        /**
        Inyector inyectorOxigeno={false, 0};
        Inyector inyectorAire={false, 0};
        **/

        broadcast chan toggleO2;
        broadcast chan toggleAir;

        int mix=0;

        o2Valve = MixChamber(O2mixed, toggleO2, o2Duty, endConfig, mix, tInsp);
        airValve =MixChamber(airMixed, toggleAir, airDuty, endConfig, mix, tInsp);


        /**
        Valvula para expirar
        **/

        broadcast chan done;
        broadcast chan encenderValvula;
        broadcast chan apagarValvula;

        expValve = ExpValve(done, mix, tExp);

        //ventilator = General(finConfiguracion, oxigenoMezclado, encenderOxigeno, apagarOxigeno, aireMezclado, encenderAire, apagarAire, mezclaEspirada, encenderValvula, apagarValvula);
        Ventilator = Control(pInsp, pExp, tInsp, tExp, totalT, toggleO2, toggleAir, done);
        // List one or more processes to be composed into a system.
        system  Config, o2Valve, airValve, expValve, Ventilator;
        //system TestProcess;
